(1, 'Silahkan hubungi kontak dibawah ini untuk mendaftar, deposit saldo atau mengajukan pertanyaan.\r\n\r\n<b>Founder & CEO (M. Sofyan Murtadlo)</b> \r\n<b>Whatsapp : 0823 3581 3045</b>\r\n<b>Instagram : technobooks.id</b>\r\n\r\n<b><a href=\"https://www.facebook.com/technobooks.id/\"><b><i class=\"fa fa-phone\"></i> Facebook</b></a></b>\r\n<b><a href=\"https://api.whatsapp.com/send?phone=6282335813045&text=Hello%20admin!!%20saya%20ingin%20bertanya!\"><b><i class=\"fa fa-phone\"></i> Add WhatsApp Admin</b></a></b> \r\n\r\n<b>KAMI MENERIMA PEMBAYARAN / DEPOSIT VIA : </b>\r\n<b> - BANK BCA, MANDIRI, dan OVO</b>\r\n<b> - PULSA TELKOMSEL </b>\r\n<b> - Paypal (PM Admin)</b>\r\n\r\n<center><a href=\"https://drive.google.com/file/d/1-BCHszFb3pgdvGRuguWgVK7Lsk5v6g2V/view?usp=drivesdk\" target=\"_blank\"><img src=\"https://play.google.com/intl/en_us/badges/images/generic/en_badge_web_generic.png\" style=\"width: 150px;\"></a></center>\r\n\r\n<b>Technobooks</b>', '2019-03-20 10:18:14'),
(2, 'Syarat & Ketentuan Technobooks telah ditetapkan kesepakatan-kesepakatan berikut.\r\n\r\n1. UMUM\r\nDengan mendaftar dan menggunakan layanan Technobooks secara otomatis anda menyetujui semua ketentuan yang kami buat. Ketentuan bisa saja berubah sewaktu-waktu tanpa pemberitahuan terlebih dahulu.\r\n\r\n2. LAYANAN\r\nTechnobooks hanya untuk sarana promosi. untuk membantu meningkatkan \"penampilan\" Akun sosial media anda.\r\nTechnobooks tidak dapat memastikan pengikut baru anda akan berinteraksi dengan anda.\r\nTechnobooks hanya menjamin anda akan mendapatkan pengikut sesuai yang anda bayar.\r\nTechnobooks tidak menjamin 100% dari akun kami memiliki gambar profil atau bio yang lengkap.\r\nTechnobooks tidak akan mengembalikan saldo jika anda salah memesan. Pastikan anda memasukan data yang benar sebelum memesan layanan.\r\nAnda Tidak Dapat Melakukan Pemesanan Untuk Hal Yang Bersifat Melanggar Hukum.\r\nTechnobooks Tidak Menjamin Semua Layanan Dapat Bertahan Selamanya.\r\n\r\n3. TANGGUNG JAWAB\r\nTechnobooks sama sekali tidak bertanggung jawab atas kerugian yang mungkin terjadi pada bisnis anda.\r\nTechnobooks tidak bertanggung jawab jika terjadi penanguhan akun,penghapusan foto atau video atau bahkan pembokiran akun sosial media anda.\r\nTechnobooks tidak bertanggung jawab atas penyalahgunaan layanan yang kami sediakan.\r\nTechnobooks di bebaskan dari segala tuntutan hukum.\r\n\r\n4. HARGA\r\nHarga yang kami tawarkan dapat berubah sewaktu-waktu. Dengan pemberitahuan atau tanpa pemberitahuan.\r\n\r\n5. PEMESANAN\r\nPesanan yang sudah di input tidak dapat di batalkan.\r\nWaktu pengerjaan yang kami lampirkan di diskripsi hanyalah perkiraan.\r\n\r\n6. SALDO\r\nTidak ada pengembalian uang yang akan dilakukan ke metode pembayaran Anda. Setelah deposit selesai, tidak ada cara untuk mengembalikannya. Anda harus menggunakan saldo Anda atas perintah dari Technobooks.\r\nAnda setuju bahwa setelah Anda menyelesaikan pembayaran, Anda tidak akan mengajukan sengketa atau tagihan balik kepada kami karena alasan apa pun.\r\n\r\n7. AKUN\r\nKami tidak akan membantu apapun yang terjadi pada akun anda jika data yang anda inputkan saat pendaftaran tidak sesuai dengan kriteria yang telah kami sarankan.\r\nJika Anda melakukan pendaftaran dan tidak melakukan deposit atau pengisian saldo dalam waktu lebih dari 1 hari maka akun Anda otomatis akan dinonaktifkan oleh sistem. Jika Anda terbukti melakukan kecurangan dalam bertransaksi di Technobooks maka kami akan menonaktifkan atau bisa saja menghapus akun Anda dari website kami.', '2019-03-20 00:00:00'),
(3, '1. Apa itu Technobooks ?\r\nTechnobooks  adalah sebuah platform bisnis yang menyediakan berbagai layanan social media marketing yang bergerak terutama di Indonesia. Dengan bergabung bersama kami, Anda dapat menjadi penyedia jasa social media atau reseller social media seperti jasa penambah Followers, Likes, dll.\r\n\r\n2. Bagaimana cara mendaftar di Technobooks ?\r\nAnda dapat langsung mendaftar di website Technobooks  pada halaman Daftar\r\n\r\n3. Bagaimana cara membuat pesanan?\r\nUntuk membuat pesanan sangatlah mudah, Anda hanya perlu masuk terlebih dahulu ke akun Anda dan menuju halaman pemesanan dengan mengklik menu yang sudah tersedia. Selain itu Anda juga dapat melakukan pemesanan melalui request API.\r\n\r\n4. Bagaimana cara melakukan deposit/isi saldo?\r\nUntuk melakukan deposit/isi saldo, Anda hanya perlu masuk terlebih dahulu ke akun Anda dan menuju halaman deposit dengan mengklik menu yang sudah tersedia. Kami menyediakan deposit melalui bank dan pulsa.', '2019-03-20 00:00:00');
